import React, { Component } from "react";
import NavComponent from "./navcomponent";

class VideosComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: null,
    };
    this.apiUrl = `https://twitterapi.artefaktas.workers.dev/api`;
  }

  componentDidMount() {
    const fetchLink = this.apiUrl;
    async function getData() {
      const res = await fetch(fetchLink);
      const jsonData = await res.json();
      return jsonData;
    }

    getData().then((res) => {
      this.setState({ data: res }, () => {
        console.log(this.state.data);
      });
    });
  }

  render() {
    return (
      <div>
        {this.state.data !== null
          ? this.state.data.map((tweet) => {
              if (tweet.extended_entities !== undefined) {
                if (tweet.extended_entities.media !== undefined) {
                  if (
                    tweet.extended_entities.media[0].video_info !== undefined
                  ) {
                    const contentType =
                      tweet.extended_entities.media[0].video_info.variants[1]
                        .content_type;
                    const videoSrc =
                      tweet.extended_entities.media[0].video_info.variants[1]
                        .url;
                    console.log(videoSrc, contentType);
                  }
                }
              }
            })
          : "Loading"}
        <NavComponent />
      </div>
    );
  }
}

export default VideosComponent;
